import React from "react";
import CartItem from "./CartItem";
import Modal from "./Modal";
import "./ModuleHolder.css"


const ModalHolder = (props) => {
    var modal = props.modalName;
    const closeModal=()=>{
        props.onClose();
    }
    const visitHandler=(event)=>{
        window.open(event);
    }

    return (
        <React.Fragment>
            {modal === "projects" &&
                <Modal onClose={closeModal}
                >
                    <h2 className="title_name" >Projects</h2>
                    <ul>
                        <li><CartItem visitlink="https://github.com/sosenkkk" onVisit={visitHandler(vis)} /></li>
                        <li><CartItem /></li>
                        <li><CartItem /></li>
                        <li><CartItem /></li>
                        <li><CartItem /></li>
                    </ul>
                   
                </Modal>
            }
            {modal === "skills" &&
                <Modal onClose={closeModal} >
                    <h2>Skills</h2>
                    
                </Modal>
            }
            {modal === "experience" &&
                <Modal onClose={closeModal} >
                    <h2>Experience</h2>
                    <ul>
                        <li></li>
                        <li></li>
                        <li></li>
                        <li></li>
                        <li></li>
                    </ul>
                </Modal>
            }
            {modal === "achievements" &&
                <Modal onClose={closeModal} >
                    <h2>Achievements</h2>
                    <ul>
                        <li></li>
                        <li></li>
                        <li></li>
                        <li></li>
                        <li></li>
                    </ul>
                </Modal>
            }
        </React.Fragment>
    )
}

export default ModalHolder;
